import React, { useState } from "react";

const UserAccount = () => {
	const token = localStorage.getItem("token");
	const [modelResult, setModelResult] = useState(null);
	const [loading, setLoading] = useState(false);

	const runModel = async () => {
		setLoading(true);
		try {
			const response = await fetch("http://your-backend-api/run-model", {
				method: "POST",
				headers: {
					"Content-Type": "application/json",
					Authorization: `Bearer ${token}`,
				},
				body: JSON.stringify({
					// If you need to send additional data to the model, add it here
				}),
			});
			const data = await response.json();
			setModelResult(data.result);
		} catch (error) {
			console.error("Error running model:", error);
			setModelResult("An error occurred while running the model.");
		}
		setLoading(false);
	};

	return (
		<div>
			<h1>Welcome to Your Account</h1>
			<p>Your token: {token}</p>
			<button onClick={runModel} disabled={loading}>
				{loading ? "Running Model..." : "Run Model"}
			</button>
			{modelResult && (
				<div>
					<h2>Model Result:</h2>
					<p>{modelResult}</p>
				</div>
			)}
		</div>
	);
};

export default UserAccount;
